def acoustic_piano(note_no: int, velocity: int, gate: float, duration: float, sr: int =44100) -> np.ndarray:
    WIN_LEN: int = 128
    n_strings: int = 1 if note_no <= 32 else (2 if note_no <= 52 else 3)


    ds: list[float] = [0.00, 0.01, -0.01]
    zs: np.ndarray = np.zeros((n_strings, int(duration*sr)))
    for i in range(n_strings):
        # feedback filter
        d: float = calc_delayar(note_no, p1=55, p2=0, p3=120/12, p4=0.5, is_sub=True)
        fbk_decay: float = calc_delayar(note_no, p1=80, p2=0, p3=120/12, p4=20, is_sub=True)
        freq: float = calc_freq(note_no+ds[i])
        c: float = np.minimum(
            np.power(10, -3/freq/fbk_decay) / np.sqrt((1 - d) ** 2 + 2 * d * (1 - d) * np.cos(2 * np.pi * freq / sr) + d ** 2),
            1
        )

        # delayline
        n_delay: int = int(sr / freq - d)
        f_delay: float = sr / freq - d - n_delay
        apf_coef: float = (1 - f_delay) / (1 + f_delay)

        # Karplus-Strong string synthesis
        zs[i] = plucked_string_excitation(freq, n_delay+WIN_LEN, duration, sr)
        zs[i] = plucked_string_delay_feedback(zs[i], WIN_LEN, n_delay, apf_coef, c, d, duration, sr)
